    const [searchParams] = useSearchParams()

    const authCode = searchParams.get('code')

    useEffect(() => {

        getAccessToken(authCode).then( accessToken => {
            console.log(accessToken)
            getUserEmail(accessToken).then(email => {
                console.log("EMAIL: " + email)
            })
        })

    },[authCode])

    return ( 
        <div>
            {authCode}
        </div>
     );
}

